function updateMultiSelect(n,t){while(n.options.length>0)n.options.remove(0);t.forEach(function(t){var i=document.createElement("option");i.value=t.value;i.innerHTML=t.description;n.options.add(i)})}function performMultiSelectAjax(n,t,i){var r=n.id+"-"+t.id+"-"+i+"-"+n.value;r in multiSelectCache?updateMultiSelect(t,multiSelectCache[r]):$.ajax({type:"POST",url:"/CritterEx/GetCrittersFilteredValueDescription",contentType:"application/json",dataType:"json",data:JSON.stringify({Name:n.value})}).done(function(n){multiSelectCache[r]=n;updateMultiSelect(t,n)})}function registerMultiSelect(n,t,i,r){n.addEventListener("change",function(){performMultiSelectAjax(n,t,r)});n.dispatchEvent(new Event("change"))}var multiSelectCache={},CAN_USE_COOKIES=!1;